import { Link } from "react-router-dom";
import { useContext } from "react";
import UserContext from "../utils/UserContext";

export const Home = () => {
  const msg = useContext(UserContext);

  return (
    <div>
      <div>{msg}</div>
      <Link to="/login">
        <button>Login</button>
      </Link>
    </div>
  );
};
